import "../App.css";
import React from "react";

function Login(){
    function checkLogin(){
        const userN = document.getElementById("un").value;
        const userP = document.getElementById("pwd").value;
        
      
        console.log("Név: "+userN);
        fetch('http://localhost:5000/api/user/letolt?nev=${userN}&pass=${userP}',
          { method: "GET",
            headers: {
            Accept: 'application/json',
            'Content-Type': 'application/json',
            }
          }).then(() =>
          {
            console.log(userN);
            console.log(userP);
            //window.location.reload();
        });
      }
    
    return(
        <form>
            <input type="text" id="un" placeholder="felhasználónév..." name="nev"/>
            <input type="password" id="pwd" placeholder="jelszó..." name="password"/>
            <button onClick={(e) => checkLogin()} >Login</button>
            
        </form>
    );
}
export default Login;
